import React from 'react';

const Footer = () => {
  return(
    <div className="FooterWrapper FooterWrapper--twoRows">
      <div className="FooterWrapper__item">logo</div>
      <div className="FooterWrapper__item">contact-form</div>
      <div className="FooterWrapper__item">links</div>
      <div className="FooterWrapper__item">om os</div>
      <div className="FooterWrapper__item">address</div>
      <div className="FooterWrapper__item">SoMe</div>
    </div>
  )
}

export default Footer;
